<?php
  namespace Application;
  
  class Bootstrap {
    
    private $xmlwriter = null;
    private $flush;
    
    public function __construct ( $indent = true, $flush = true ) {
      if ( $this->xmlwriter == null ) {
        $this->xmlwriter = new \XMLWriter ( );
        $this->xmlwriter->openURI ( 'php://output' );
      }
      $this->xmlwriter->setIndent ( $indent );
      $this->flush = $flush;
    }
    
    public function __destruct ( ) {
      $this->xmlwriter->endElement ( );
      if ( $this->flush ) {
        $this->xmlwriter->flush ( );
      }
      unset ( $this->xmlwriter );
    }
    
    public function doctype ( ) {
      $this->xmlwriter->writeDtd ( 'html' );
    }
    
    public function html ( $language = 'en' ) {
      $this->xmlwriter->startElement ( 'html' );
        $this->xmlwriter->writeAttribute ( 'lang', $language );
    }
    
    public function head ( $title = '', $meta = array ( ), $link = array ( ) ) {
      $this->xmlwriter->startElement ( 'head' ); //head open
      $this->title ( $title );
      $this->meta_array ( $meta );
      $this->link_array ( $link );
      $this->xmlwriter->endElement ( ); //head close
    }
    
    public function title ( $text ) {
      $this->xmlwriter->startElement ( 'title' );
        $this->xmlwriter->text ( $text );
      $this->xmlwriter->endElement ( );
    }
    
    public function meta_array ( $meta ) {
      if ( is_array ( $meta ) && !empty ( $meta ) ) {
        $this->xmlwriter->writeComment ( 'Meta' );
        foreach ( $meta as $key => $value ) {
          if ( isset ( $value [ 'name' ] ) && isset ( $value [ 'content' ] ) ) {
            $this->meta ( $value [ 'name' ], $value [ 'content' ] );
          } elseif ( is_array ( $value ) && sizeof ( $value ) >= 2 ) {
            call_user_func ( array ( $this, 'meta' ), $value );
          }
        }
      }
    }
    
    public function meta ( $name, $content ) {
      $this->xmlwriter->startElement ( 'meta' );
        $this->xmlwriter->writeAttribute ( 'name', $name );
        $this->xmlwriter->writeAttribute ( 'content', $content );
      $this->xmlwriter->endElement ( );
    }
    
    public function link_array ( $link ) {
      if ( is_array ( $link ) && !empty ( $link ) ) {
        $this->xmlwriter->writeComment ( 'Cascading Style Sheets' );
        foreach ( $link as $key => $value ) {
          if ( ( $hypertext_reference_name = ( isset ( $value [ 'hypertext_reference' ] ) ? 'hypertext_reference' : ( isset ( $value [ 'href' ] ) ? 'href' : false ) ) ) !== false ) {
            if ( isset ( $value [ 'relationship' ] ) ) {
              $this->link ( $value [ $hypertext_reference_name ], $value [ 'relationship' ] );
            } else {
              $this->link ( $value [ $hypertext_reference_name ] );
            }
          } elseif ( is_array ( $value ) && sizeof ( $value ) >= 1 ) {
            call_user_func ( array ( $this, 'link' ), $value );
          }
        }
      }
    }
    
    public function link ( $hypertext_reference, $relationship = null ) {
      $this->xmlwriter->startElement ( 'link' );
        $this->xmlwriter->writeAttribute ( 'href', $hypertext_reference );
        $this->xmlwriter->writeAttribute ( 'rel', ( is_null ( $relationship ) ? Relationship :: stylesheet ( ) : $relationship ) );
      $this->xmlwriter->endElement ( ); //link
    }
    
    public function divide ( $divide_class_array = array ( ), $internal_function = null, $parameters = array ( ) ) {
      $this->xmlwriter->startElement ( 'div' );
        $this->xmlwriter->writeAttribute ( 'class', implode ( ' ', $divide_class_array ) );
        if ( !is_null ( $internal_function ) && is_callable ( $internal_function ) ) {
          call_user_func_array ( $internal_function, $parameters );
        }
      $this->xmlwriter->endElement ( ); //div
    }
    
    public function anchor ( $anchor_class_array = array ( ), $hypertext_reference, $text ) {
      $this->xmlwriter->startElement ( 'a' );
        $this->xmlwriter->writeAttribute ( 'class', ( sizeof ( $anchor_class_array ) > 0 ? implode ( ' ', $anchor_class_array ) : null ) );
        $this->xmlwriter->writeAttribute ( 'href', $hypertext_reference );
        $this->xmlwriter->text ( $text );
      $this->xmlwriter->endElement ( ); //a
    }
    
    public function divide_anchor ( $divide_class_array = array ( ), $anchor_class_array = array ( ), $hypertext_reference, $text ) {
      $this->divide ( $divide_class_array, function ( $anchor_class_array, $hypertext_reference, $text ) {
        $this->anchor ( $anchor_class_array, $hypertext_reference, $text );
      }, array ( $anchor_class_array, $hypertext_reference, $text ) );
    }
    
    public function blog_header ( ) {
      $this->xmlwriter->startElement ( 'header' );
        $this->xmlwriter->writeAttribute ( 'class', 'blog-header py-3' );
        $this->xmlwriter->startElement ( 'div' );
          $this->xmlwriter->writeAttribute ( 'class', 'row flex-nowrap justify-content-between align-items-center' );
          $this->divide_anchor ( array ( 'col-4', 'pt-1' ), array ( Classes :: text_muted ( ) ), '#', 'Subscribe' );
          $this->divide_anchor ( array ( 'col-4', 'text-center' ), array ( 'blog-header-logo', Classes :: text_dark ( ) ), '#', 'Large' );
          $this->xmlwriter->startElement ( 'div' );
            $this->xmlwriter->writeAttribute ( 'class', 'col-4 d-flex justify-content-end align-items-center' );
            $this->xmlwriter->startElement ( 'a' );
              $this->xmlwriter->writeAttribute ( 'class', Classes :: text_muted ( ) );
              $this->xmlwriter->writeAttribute ( 'href', '#' );
              $this->xmlwriter->writeRaw ( '<i class="fas fa-search mx-3"></i>' );
            $this->xmlwriter->endElement ( ); //a
            $this->anchor ( array ( 'btn', 'btn-sm', 'btn-outline-secondary' ), '#', 'Sign up' );
          $this->xmlwriter->endElement ( ); //div
        $this->xmlwriter->endElement ( ); //div
      $this->xmlwriter->endElement ( ); //header
      
    }
    
    public $nl = 0;
    
    public function blog_nav ( $nav_items = array ( ) ) {
      $this->xmlwriter->startElement ( 'div' );
        $this->xmlwriter->writeAttribute ( 'class', 'nav-scroller py-1 mb-2' );
        $this->xmlwriter->startElement ( 'div' );
          $this->xmlwriter->writeAttribute ( 'class', 'nav nav-fill justify-content-between' );
          foreach ( $nav_items as $key => $value ) {
            if ( is_array ( $value ) && sizeof ( $value ) >= 2 ) {
              $this->xmlwriter->startElement ( 'li' );
                $this->xmlwriter->writeAttribute ( 'class', 'nav-item' );
                $classes = [ 'primary', 'secondary', 'success', 'danger', 'warning', 'info', 'dark' ];
                $this->anchor ( array ( 'p-2', 'nav-link', 'text-' . $classes [ $this->nl++ ] ), $value [ 1 ], $value [ 0 ] );
              $this->xmlwriter->endElement ( ); //li
            }
          }
        $this->xmlwriter->endElement ( ); //nav
      $this->xmlwriter->endElement ( ); //div
    }
    
    public function blog_jumbotron ( $title, $text ) {
