              } else {
                $this->xmlwriter->writeAttribute ( 'data-src', 'holder.js/328x328?theme=thumb' );
              }
              $this->xmlwriter->writeAttribute ( 'alt', 'Card image cap' );
            $this->xmlwriter->endElement ( ); //img
            $this->xmlwriter->startElement ( 'div' );
              $this->xmlwriter->writeAttribute ( 'class', 'card-img-overlay align-items-start' );
              $this->xmlwriter->startElement ( 'div' );
