                  $this->xmlwriter->writeAttribute ( 'class', 'badge badge-' . $classes [ $this->fp - 1 ] . ' mb-2' );
                  $this->xmlwriter->writeAttribute ( 'class', implode ( ' ', array ( 'd-inline-block', 'mb-2', $category [ 1 ] ) ) );
                  $this->xmlwriter->text ( $category [ 0 ] );
                $this->xmlwriter->endElement ( ); //span
                $this->xmlwriter->startElement ( 'span' );
                  $this->xmlwriter->writeAttribute ( 'class', 'align-middle' );
                  $this->xmlwriter->writeAttribute ( 'style', 'float: right' );
                  $this->xmlwriter->startElement ( 'small' );
                    $this->xmlwriter->writeAttribute ( 'style', '' );
                    $this->xmlwriter->text ( $date );
                    $this->xmlwriter->writeRaw ( '&nbsp;&nbsp;<i class="far fa-comment-dots"></i>&nbsp;3' );
                  $this->xmlwriter->endElement ( ); //small
                $this->xmlwriter->endElement ( ); //span
              $this->xmlwriter->endElement ( ); //div
              
              $this->xmlwriter->startElement ( 'h3' );
                $this->xmlwriter->writeAttribute ( 'class', 'mb-0' );
