                $this->xmlwriter->writeAttribute ( 'href', '#' );
                $this->xmlwriter->text ( 'Continue reading...' );
              $this->xmlwriter->endElement ( ); //a
              
            $this->xmlwriter->endElement ( ); //div
          $this->xmlwriter->endElement ( ); //div
        $this->xmlwriter->endElement ( ); //div
      }
    }
    
    public function blog_post ( $title, $date, $author, $text ) {
      $this->xmlwriter->startElement ( 'div' );
        $this->xmlwriter->writeAttribute ( 'class', 'blog-post' );
        $this->xmlwriter->startElement ( 'h2' );
          $this->xmlwriter->writeAttribute ( 'class', 'blog-post-title' );
          $this->xmlwriter->text ( $title );
        $this->xmlwriter->endElement ( ); //h2
        $this->xmlwriter->startElement ( 'p' );
          $this->xmlwriter->writeAttribute ( 'class', 'blog-post-meta' );
          $this->xmlwriter->startElement ( 'span' );
            $this->xmlwriter->text ( "{$date} by" );
          $this->xmlwriter->endElement ( ); //span
          $this->anchor ( array ( ), '#', $author );
        $this->xmlwriter->endElement ( ); //p
        $this->blog_process_text ( $text );
      $this->xmlwriter->endElement ( ); //div
    }
    
    public function blog_process_text ( $text ) {
      $lines = array_filter ( explode ( "\r\n\r\n", $text ) );
      foreach ( $lines as $key => $value ) {
        $this->xmlwriter->startElement ( 'p' );
          $this->xmlwriter->writeRaw ( $value );
        $this->xmlwriter->endElement ( ); //p
      }
    }
    
