    public function script_array ( $script ) {
      if ( is_array ( $script ) && !empty ( $script ) ) {
        $this->xmlwriter->writeComment ( 'JavaScript' );
        foreach ( $script as $key => $value ) {
          if ( is_array ( $value ) && sizeof ( $value ) == 1 ) {
            $this->script ( $value [ 0 ], null );
          } elseif ( is_array ( $value ) && sizeof ( $value ) > 1 ) {
            $this->script ( null, $value [ 1 ] );
          }
        }
      }
    }
    
    public function script ( $source, $javascript = null ) {
      $this->xmlwriter->startElement ( 'script' );
        if ( !empty ( $source ) ) {
          $this->xmlwriter->writeAttribute ( 'src', $source );
        }
        $this->xmlwriter->text ( $javascript );
      $this->xmlwriter->endElement ( );
    }
    
    public function a (  $text = '', $hypertext_reference = '#', $class = '' ) {
      $this->xmlwriter->startElement ( 'a' );
        if ( !empty ( $class ) ) {
          $this->xmlwriter->writeAttribute ( 'class', $class );
        }
        $this->xmlwriter->writeAttribute ( 'href', $hypertext_reference );
        $this->xmlwriter->text ( $text );
      $this->xmlwriter->endElement ( );
    }
    
